Illustration of keyword query rules

Query by Service URL by default when entering the keyword in the query box
Query by State when prefixing the keyword with @ in the query box
For example, the keyword @500 in the query box indicates querying the invocation chains whose return state code is 500 


Conduct federated query by connecting Service URL and State with @
For example, the keyword monitor@500 in the query box indicates querying the invocation chains whose Service URL contains monitor and State code is 500


Query by all fields in the format of url="xx", state="xx". The key value before "=" is the query field. The query functionality currently supports parallel query by Service URL, State, Class and Method. The value after "=" is the query keyword. The query functionality supports the multiple keyword query in Rule 5 and the fuzzy match query in Rule 6
For example, url="montior", state="500 404", method="*query*" indicates querying the invocation chains whose Service URL contains monitor, State code is 500 or 404, and Method contains query


The query fiedls support multiple keywords query. Below are detailed rules:
Support OR query by separating keywords with a space
For example,   indicates either kwd1 or kwd2


Support AND query by connecting all keywords with +
For example, + indicates both kwd1 and kwd2


Support the co-existence of a space and +, with keywords connected by + being taken as a whole
For example, +   indicates the co-existence of kwd1 and kwd2 or kwd3 or kwd4




Prefix and suffix the keyword with * for fuzzy match
For example, \*monitor\* indicates that all invocation chains containing monitor shall be matched



Notes:

All queried keywords shall be segmented when there is no * among keywords. Segmented keywords shall not be highlighted. Prefix and suffix the keywords with * for fuzzy match. 
The fuzzy match query supports AND query only, i.e. the keyword in the format of *monitor* do not allow a space that connects another keyword after it for OR query



